var b="url",c="وضعیت_کارجو_مشاهده_.html",d="generationDate",e=new Date(1754304817593.56),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="4c0ac10badc44abd8ec995c288d3cf2a",w="type",x="Axure:Page",y="وضعیت کارجو(مشاهده)",z="notes",A="annotations",B="fn",C="2",D="ownerId",E="6f01038410744047b4bb657ca2de46e9",F="label",G="(Tree Node)",H="Note",I="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">راهنمای وضعیت کارجو </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#2558A1;\">برای کلیه موجودیت های درگیر در فرایند&quot;مصاحبه کارجو&quot; قابل نمایش باشد</span></p>",J="3",K="eb322cf2b2a74253b886d0225c781cb7",L="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه کارجو پس از دریافت پیامک شرکت در مصاحبه تخصصی حضوری با </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">ارسال عدد 1 نسبت به لغو مصاحبه تخصصی </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">اقدام نمود اکشن های زیر انجام گردد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF006B;\">1</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. فیلد&nbsp; &quot;وضعیت کارجو&quot; به &quot;لغو مصاحبه تخصصی توسط کارجو&quot; تغییر یابد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">2</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. به دلیل آنکه برای کارجو قبلا سیکل ایجاد گردیده است وضعیت &quot;لغو مصاحبه تخصصی توسط کارجو&quot; نیز در </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FD0000;\">سیکل </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">برای کارجوی مربوطه </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0808;\">درج </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">گردد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">3</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">.کارجو پیامکی مبنی بر تایید لغو مصاحبه تخصصی دریافت نماید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">4</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">.مصاحبه کننده(ها) پیامکی مبنی بر لغو مصاحبه تخصصی دریافت نمایند</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">5</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. مدیریت واحد جذب و استخدام پیامکی مبنی بر لغو مصاحبه تخصصی دریافت نماید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">6.</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"> ادامه سیکل متوقف گردیده و سیکل کارجو غیرفعال گردد</span></p>",M="4",N="6b4fbb7a2b2b43219f340ebd7adb2be7",O="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">چنانچه کارجو به هر دلیلی در مصاحبه تخصصی حضور نیافت</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF006B;\">1</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. فیلد&nbsp; &quot;وضعیت کارجو&quot; به &quot;عدم شرکت در مصاحبه تخصصی&quot; تغییر&nbsp; یابد </span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">2</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. به دلیل آنکه برای کارجو قبلا سیکل ایجاد گردیده است وضعیت&quot;عدم شرکت در مصاحبه تخصصی&quot; نیز در </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FD0000;\">سیکل </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">برای کارجوی مربوطه </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0808;\">درج </span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">گردد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">3</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">. فیلد &quot;وضعیت کارجو&quot; در کلیه گرید های مربوطه به وضعیت &quot;عدم شرکت در مصاحبه تخصصی&quot; تغییر یابد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">4.</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"> ادامه سیکل متوقف گردیده و سیکل کارجو غیرفعال گردد</span></p>",P="style",Q="baseStyle",R="627587b6038d43cca051c114ac41ad32",S="pageAlignment",T="center",U="fill",V="fillType",W="solid",X="color",Y=0xFFFFFFFF,Z="image",ba="imageAlignment",bb="near",bc="imageRepeat",bd="auto",be="favicon",bf="sketchFactor",bg="0",bh="colorStyle",bi="appliedColor",bj="fontName",bk="Applied Font",bl="borderWidth",bm="borderVisibility",bn="borderFill",bo=0xFF797979,bp="cornerRadius",bq="cornerVisibility",br="outerShadow",bs="on",bt=false,bu="offsetX",bv=5,bw="offsetY",bx="blurRadius",by="spread",bz="r",bA=0,bB="g",bC="b",bD="a",bE=0.349019607843137,bF="adaptiveStyles",bG="interactionMap",bH="onLoad",bI="eventType",bJ="OnPageLoad",bK="description",bL="Page Loaded",bM="cases",bN="Case 1",bO="conditionString",bP="if value of Loginv equals &quot;1&quot;",bQ="isNewIfGroup",bR="caseColorHex",bS="AB68FF",bT="condition",bU="exprType",bV="binaryOp",bW="op",bX="==",bY="leftExpr",bZ="fcall",ca="functionName",cb="GetGlobalVariableValue",cc="arguments",cd="globalVariableLiteral",ce="variableName",cf